import React,{Component} from 'react';
import {Nav,NavDropdown,Navbar,Form,FormControl,Button, NavItem, NavLink} from 'react-bootstrap';
import {Link} from "react-router-dom";
import "../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import '../../node_modules/font-awesome/css/font-awesome.min.css';

export default class NavBar extends Component{
    
constructor(props){
    super(props);
    this.state={
        username:""
    }

}
render()
{
return(
  <>
    <Navbar bg="tra" expand="lg" >
        <Navbar.Brand ><Link style={{textDecoration:"none",color: "#fff"}} to="/"><i style={{padding:"5px"}} className="fa fa-audio-description"/>AddJency</Link></Navbar.Brand>
        {/* <Navbar.Toggle aria-controls="basic-navbar-nav" /> */}
        <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <NavDropdown title="Dropdown" id="basic-nav-dropdown">
            <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
          </NavDropdown>
        </Nav>
        <Form inline>
          <FormControl type="text" placeholder="Search" className="mr-sm-2" />
          <Button variant="outline-success">Search</Button>
        </Form>
        <NavLink><Link style={{textDecoration:"none",color: "#fff"}} to="/signin">Sign In</Link></NavLink>
          <NavLink><Link style={{textDecoration:"none",color: "#fff"}} to="/signup">Sign Up</Link></NavLink>
        </Navbar.Collapse>
    </Navbar>
    </>
    );
}
}
